/**
 * @param {string} alias
 */
async function getMaterialSymbolSVG(alias) {
  const [name, suffix] = alias.toLowerCase().split('#');
  const scope = (suffix === 'filled') ? 'fill1' : 'default';
  return {
    name,
    suffix,
    ...await fetchSVGInfo(`https://fonts.gstatic.com/s/i/short-term/release/materialsymbolsoutlined/${name}/${scope}/24px.svg`),
  };
}

/**
 *
 */
export async function verifyMaterialSymbols() {
  await Promise.all([...svgAliasMap.entries()].map(async ([alias, { path, viewBox }]) => {
    const info = await getMaterialSymbolSVG(alias);
    if (!info.path) return;
    if (info.path !== path || info.viewBox !== viewBox) {
      console.warn(`addSVGAlias('${alias}', '${info.path}', '${info.viewBox}');`);
    }
  }));
  console.log('Verified material symbols');
}

/** @type {Set<string>} */
let checkedUnaliased;

/**
 * @return {Promise<any>}
 */
export async function reportUnaliasedMaterialSymbols() {
  if (!unaliased.size) return;

  checkedUnaliased ??= new Set();
  await Promise.all(
    [...unaliased].map(async (alias) => {
      if (checkedUnaliased.has(alias)) return;
      checkedUnaliased.add(alias);
      const { path, viewBox, name, suffix } = await getMaterialSymbolSVG(alias);
      if (!path) return;
      if (suffix && svgAliasMap.has(name)) {
        const aliased = svgAliasMap.get(name);
        if (aliased.path === path && aliased.viewBox === viewBox) {
          console.log(alias, name, 'are identical');
          return;
        }
      }
      console.warn(`addSVGAlias('${alias}', '${path}', '${viewBox}');`);
    }),
  );
}
